import React, { Component } from 'react';
import FormField from '../Utils/Form/FormField';

import { connect } from 'react-redux';

class UpdatePersonalInfo extends Component {

  state = {
  	formError: false,
		formSuccess: '',
		formData: {
			email: {
				element: 'input',
				value: '',
				config: {
					name: 'email_input',
					type: 'email',
					placeholder: 'Enter your email'
				},
				validation: {
					required: true,
					email: true
				},
				valid: false,
				touched: false,
				validationMessage:''
			},

			password: {
				element: 'input',
				value: '',
				config: {
					name: 'password_input',
					type: 'password',
					placeholder: 'Enter your password'
				},
				validation: {
					required: true,
					email: false
				},
				valid: false,
				touched: false,
				validationMessage:''
			}
		}
  }

  render() {
    return (
      <div>
        My UpdatePersonalInfo
      </div>
    )
  }
}

export default UpdatePersonalInfo;
